import React, { useState } from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import './DocumentDetailPage.css';

const DocumentDetailPage = () => {
    const location = useLocation();
    const navigate = useNavigate();
    const doc = location.state?.doc;

    const [status, setStatus] = useState('신규 등록');
    const [rejectionReason, setRejectionReason] = useState('');
    const [showModal, setShowModal] = useState(false);

    const handleSubmit = () => {
        setShowModal(true);
    };

    const confirmSubmit = () => {
        console.log('처리됨:', { status, rejectionReason });
        navigate(-1);
    };

    const cancelSubmit = () => setShowModal(false);

    if (!doc) return <div>문서 정보가 없습니다.</div>;

    return (
        <div className="detailContainer">
            <h2>서류 상세 정보</h2>

            <div className="formGrid">
                <label>이름</label>
                <input readOnly value={doc.name} />

                <label>학과</label>
                <input readOnly value={doc.major || '물리학과'} />

                <label>학번</label>
                <input readOnly value={doc.studentId} />

                <label>서류 유형</label>
                <input readOnly value={doc.type} />

                <label>서류 확인</label>
                <input readOnly value={doc.fileTitle} />
            </div>

            <div className="checkSection">
                <strong>1차 검토 내용</strong>
                <div className="checkBox">
                    - 전공 관련 경험<br />
                    - 가계곤란 사유<br />
                    - 가족관계증명서
                </div>
            </div>

            <div className="approvalSection">
                <strong>관리자 최종 승인</strong>
                <div className="radioGroup">
                    {['신규 등록', '반려 처리', '승인 처리'].map(opt => (
                        <label key={opt}>
                            <input
                                type="radio"
                                name="status"
                                value={opt}
                                checked={status === opt}
                                onChange={() => setStatus(opt)}
                            /> {opt}
                        </label>
                    ))}
                </div>

                {status === '반려 처리' && (
                    <div className="rejectionBox">
                        <label>관리자 반려 사유</label>
                        <textarea
                            rows="3"
                            value={rejectionReason}
                            onChange={(e) => setRejectionReason(e.target.value)}
                            placeholder="반려 사유를 입력하세요."
                        />
                    </div>
                )}
            </div>

            <div className="buttonGroup">
                <button className="submitBtn" onClick={handleSubmit}>등록</button>
                <button onClick={() => navigate(-1)}>취소</button>
            </div>

            {showModal && (
                <div className="modalOverlay">
                    <div className="modal">
                        <p>등록하시겠습니까?</p>
                        <div className="modalBtns">
                            <button onClick={confirmSubmit}>확인</button>
                            <button onClick={cancelSubmit}>취소</button>
                        </div>
                    </div>
                </div>
            )}
        </div>
    );
};

export default DocumentDetailPage;
